/* Scan Queues based on receiving input, user algorithm here */
Select               = 1
WAIT  (.1) 
while (isDone<numProcs) { /* Run a loop until end of the simulation */
	while (Select       <= 5)  { /* Loop for the number of Queues */
		if (getBlockStatus("MySmartResource"+ID,"length",5) > 0){
			WAIT(.1)
			SEND(pop,5)
		}

		if (getBlockStatus("MySmartResource"+ID,"length",Select) > 0) { /* Number of items in a selected queue- Input Queue */
			WAIT (.1)  /* Time before popping the transaction out of the queue */
			SEND (pop,Select) /* Sending the Queue number to the Pop port of this block which is connected to the Queue Pop Port */
		}
		Select   = Select + 1 /* Increment Queue Number Counter */
	}
	Select               = 1 /* Reset Queue Number Counter to start the loop again */
	WAIT  (.1)  /* Time betwen loops */
}

